def determine_champion(team1_actions: str, team2_actions: str) -> str:
    plays = ['()', '[]', '8<']
    w = 1
    for i in range(0, len(team1_actions) // 2):
        m = plays.index(team1_actions[2 * i:2 * i + 2])
        n = plays.index(team2_actions[2 * i:2 * i + 2])
        if m == n + 1 or m == n - 2:
            w += 1
        if m == n + 2 or m == n - 1:
            w -= 1
    if w > 0:
        return 'TEAM 1 WINS'
    elif w == 0:
        return 'TIE'
    else:
        return 'TEAM 2 WINS'

